import Alert from 'react-bootstrap/Alert';

function SubmitAlert() {
  return (
    <>
        <Alert key={'success'} variant={'success'} id=''>
          Successfully Registered .
        </Alert>
        <Alert key={'warning'} variant={'warning'}>
          Existed Email !
        </Alert>
    </>
  );
}

export default SubmitAlert;
